    careType?: string;
    onClick?: any;
}

let clickCount = 0;
const FilterButton: FC<FiletrButtonProps> = ({name, value, onClick, careType}) => {

    return (


        <button 
            value={value} 
            onClick={(event) => {
                onClick({careType})
